Welcome to Crazy Youngster Youtube Channel. My name is Ly Thai, I love making funny compilations of my favorite celebrities. I hope you guys like my channel and don't forget to subscribe!

///COPYRIGHT ISSUES/// 
My purpose, when making COMPILATIONS, is NOT to steal other people's videos, but to share those in quality compilation with other people. If any owner of clips, used in my compilation, has a copyright issue, feel free to contact me by personal message and add title COPYRIGHT ISSUE. I will remove the clip, video or come to an agreement. Thank you. Using or sharing my compilations is allowed, so feel free to share it anywhere, but it would be nice, to use direct link of video, not of copies. Thanks.

